import { StyleSheet } from 'react-native';

const registerStepOneStyles = StyleSheet.create({
    registerTitleText: {
        width: 199,
        height: 54,
        color: '#000000',
        marginBottom: 80,
        fontSize: 48,
        fontWeight: "bold",
    },

    inputEmail: {
        height: 40,
        margin: 12,
        borderWidth: 1,
        padding: 10,
        backgroundColor: "#000000",
    },

    inputPassword: {
        height: 40,
        margin: 12,
        borderWidth: 1,
        padding: 10,
        backgroundColor: "#000000",
    },
});

export { registerStepOneStyles }
